                record: recordTypeConverter.ConvertToCustom(RecordTypes.COBJ),
                type: Mutagen.Bethesda.Binary.ObjectType.Record))
            {
                SkyrimMajorRecordBinaryWriteTranslation.WriteEmbedded(
                    item: item,
